CREATE TABLE captcha_sessions (
  id int(11) unsigned NOT NULL AUTO_INCREMENT,
  captcha_time int(11) unsigned NOT NULL,
  ip_address varchar(16) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  word varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (id)
) COMMENT='Captcha session data';

CREATE TABLE captcha_words (
  id mediumint(5) unsigned NOT NULL AUTO_INCREMENT,
  word varchar(16) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (id)
) COMMENT='Captcha alphabet words, better then RANDOM strings';

